// Home.js

import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { handleError, handleSuccess } from '../utils/ReactToastify';
import { ToastContainer } from 'react-toastify';
import '../utils/ReactToastifyCustom.css';
import '../utils/loading.css';

function Home() {
    const [loggedInUser, setLoggedInUser] = useState('');
    const [users, setUsers] = useState([]);
    const [loading, setLoading] = useState(false);
    const [fadeOut, setFadeOut] = useState(false);
    const navigate = useNavigate();

    useEffect(() => {
        setLoggedInUser(localStorage.getItem('loggedInUser'));
    }, []);

    const handleLogout = () => {
        setLoading(true);
        setFadeOut(false);

        setTimeout(() => {
            setFadeOut(true);
            setTimeout(() => {
                localStorage.removeItem('accessToken');
                localStorage.removeItem('refreshToken');
                localStorage.removeItem('loggedInUser');
                handleSuccess('User logged out successfully');
                navigate('/login');
            }, 250);
        }, 1000);
    };

    const fetchUsers = async () => {
        setLoading(true);
        try {
            const url = "http://localhost:8080/Users";
            const accessToken = localStorage.getItem('accessToken');
            const headers = {
                headers: {
                    'Authorization': `Bearer ${accessToken}`
                }
            };
            let response = await fetch(url, headers);
            if (response.status === 403) {
                // Token might be expired, attempt to refresh
                const refreshToken = localStorage.getItem('refreshToken');
                const refreshResponse = await fetch('http://localhost:8080/auth/refresh-token', {
                    method: 'POST',
                    headers: {
                        'Content-Type': 'application/json'
                    },
                    body: JSON.stringify({ refreshToken })
                });
                const result = await refreshResponse.json();
                if (result.success) {
                    localStorage.setItem('accessToken', result.accessToken);
                    localStorage.setItem('refreshToken', result.refreshToken);
                    // Retry fetching users with new access token
                    response = await fetch(url, { headers: { 'Authorization': `Bearer ${result.accessToken}` } });
                } else {
                    handleError(result.message);
                    return;
                }
            }
            const result = await response.json();
            setUsers(result);
        } catch (err) {
            handleError(err.message || 'An error occurred');
        } finally {
            setLoading(false);
        }
    };

    useEffect(() => {
        fetchUsers();
    }, []);

    return (
        <div className='container'>
            <h1>Welcome {loggedInUser}</h1>
            <div>
                {loading ? (
                    <div className={`loading-overlay ${fadeOut ? 'hidden' : ''}`}>
                        <img src='/apple-loading.gif' alt='Loading...' className='loading-spinner' />
                    </div>
                ) : users.length > 0 ? (
                    users.map((user, index) => (
                        <ul key={index}>
                            <li>Name: {user.name}</li>
                            <li>Email: {user.email}</li>
                            <li>Joined: {new Date(user.createdAt).toLocaleDateString()}</li>
                        </ul>
                    ))
                ) : (
                    <p>No users found</p>
                )}
            </div>

            <button onClick={handleLogout}>Logout</button>

            <ToastContainer />
        </div>
    );
}

export default Home;
